                } // if obj2 already loaded

                // Add the $obj1 (UsuarioReport) to $obj2 (Empresa)
                $obj2->addUsuarioReport($obj1);

            } // if joined row was not null

            $results[] = $obj1;
        }
        $stmt->closeCursor();

        return $results;
    }


