     * @param      PropelPDO $con the connection to use
     * @return UsuarioReport
     */
    public static function retrieveByPK($pk, PropelPDO $con = null)
    {

        if (null !== ($obj = UsuarioReportPeer::getInstanceFromPool((string) $pk))) {
            return $obj;
        }

        if ($con === null) {
            $con = Propel::getConnection(UsuarioReportPeer::DATABASE_NAME, Propel::CONNECTION_READ);
        }

        $criteria = new Criteria(UsuarioReportPeer::DATABASE_NAME);
        $criteria->add(UsuarioReportPeer::ID, $pk);

        $v = UsuarioReportPeer::doSelect($criteria, $con);

        return !empty($v) > 0 ? $v[0] : null;
    }

